import * as React from 'react'
import MinimalLayout from '../shared/Outlet'

const AuthLogin = React.lazy(() => import('../authentication/Login'))
const AuthRegister = React.lazy(() => import('../authentication/Register'))

const LoginRoutes = {
  path: '/',
  element: <MinimalLayout />,
  children: [
    {
      path: '/login',
      element: <AuthLogin />
    },
    {
      path: '/register',
      element: <AuthRegister />
    }
  ]
}

export default LoginRoutes
